/* eslint-disable jsx-a11y/img-redundant-alt */
import React from 'react'
const products = [
  {
    id: 1,
    name: 'Basic Tee',
    href: '#',
    imageSrc: 'https://media.zid.store/bda63855-f7ff-4be7-bd9f-1d497a22336c/7cad1f3f-ab5a-4c42-888f-71b8127c4133.png',
    imageAlt: "Front of men's Basic Tee in black.",
    price: '$35',
    color: 'Black',
  },
  // More products...
]
const Card = () => {
  return (
    <div class="card">
    <img src="https://example.com/image.jpg" alt="Image of a product" class="card-img-top" />
    <div class="card-body">
      <h5 class="card-title">Product Title</h5>
      <p class="card-text">Product description</p>
      <div class="card-actions">
        <button class="btn btn-primary">Add to cart</button>
        <p class="card-subtitle mb-2 text-muted">Price: $100</p>
      </div>
    </div>
  </div>
  )
}

export default Card
